// src/pages/Home.js
import React from "react";
import banner01 from "./assets/Banner01.jpg";

const Home = () => {
  return (
    <div
      className="h-screen bg-cover bg-center"
      style={{ backgroundImage: `url(${banner01})` }}
    >
      <div className="flex items-center justify-center h-full bg-black bg-opacity-50">
        <h1 className="text-white text-3xl sm:text-4xl md:text-5xl lg:text-6xl text-center p-4">
          Welcome to ISKCON Temple
        </h1>
        <p className="text-white text-base sm:text-lg md:text-xl lg:text-2xl text-center p-2">
          Experience peace, devotion, and community.
        </p>
      </div>
    </div>
  );
};

export default Home;
